Actionscript.script:
/*掌炮蓄力 ++ ;
   	if (_parent._name == _root.控制目标 && Key.isDown(_root.武器技能键) && 掌炮蓄力 < 18)
	{
		gotoAndPlay("掌炮循环");
	}*/

onClipEvent(load){
   	if (_parent._parent._name == _root.控制目标 && Key.isDown(_root.武器技能键) )
	{
		_parent.stop();
		_parent.掌炮蓄力 += 1;
	}else{
		_parent.play();
	}
}
onClipEvent(enterFrame){
   	if (_parent._parent._name == _root.控制目标 && Key.isDown(_root.武器技能键) &&  _parent.掌炮蓄力 < 18.23)
	{
		_parent.stop();
		_parent.掌炮蓄力 += 0.23;
	}else{
		_parent.play();
	}
}

onClipEvent(enterFrame){
	if(_parent.掌炮蓄力){
		this._xscale = 100 + _parent.掌炮蓄力 * 10;
		this._yscale = 100 + _parent.掌炮蓄力 * 10;
	}

}

onClipEvent (load) {
	_parent._parent.skillShadow = this;
	if (!_root.是否阴影)
	{
		this._visible = false;
	}
	缩放乘数 = 3.611 * 175 / _parent._parent.身高;
	if (_parent._parent.技能浮空 == true)
	{
		if (_parent._parent.浮空)
		{
			this._y = 233.05 + (_parent._parent.起始Y - _parent._parent._y - _parent._parent.垂直速度) * 缩放乘数;
		}
	}
}
onClipEvent (enterFrame) {
	if (_root.是否阴影 and (_parent._parent.浮空 or (_parent._parent.技能浮空 == true)))
	{
		this._y = 233.05 + (_parent._parent.起始Y - _parent._parent._y - _parent._parent.垂直速度) * 缩放乘数;
	}
	else
	{
		this._y = 233.05;
	}
}
